    included all expenditures, but was linked to William Jefferson from two different
    records.  When the duplicate record was combined the deleted record lost its link
    to this candidate?s record.  All disbursements that are reported administrative
    are administrative and are not in connection with a federal candidate or election.
    \ Salaries paid on the administrative split are for employees who spend less than
    25% of their work hours on federal election activity. All payments for payroll,
    payroll taxes and insurance that are reported as administrative are not paid on
    behalf of employees who spend more than 25% of there work time on federal election
    activity.   Salaries reported on line 21b are for employees who spend less than
    25% of their work hours on federal election activity. All payments for payroll,
    payroll taxes and insurance that are reported on line 21b are not paid on behalf
    of employees who spend more than 25% of there work time on federal election activity.
